import {useState, useEffect} from 'react';
import React, {Component} from 'react';
import "./App.css"
import Button from 'react-bootstrap/ToggleButton';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

const serverRoot = "http://localhost:3300";

class App extends Component {
    constructor(props) {
      super(props);
      this.state = {
          loggedIn: false,
          currentUserId: null,
          managerStatus: null
      }
    }
    async onClick() { 
      try {
        let response = await axios.get(serverRoot+"/manager/employee-list/");
        console.log(response)
      }
      catch(e) {
        alert("Server is not running.");
      }
    }
    render () {
      return (
      <>
      <h1>Log-In Page</h1>
      <Button onClick={this.onClick} variant="primary">Primary</Button>{' '}
      </>
      );
    }
}

export default App;
